const ACNLclock={loadCSS:()=>{},init:()=>{ACNLclock.src=document.getElementById("ACNLclock-script").src.replace("/ACNLclock/script.min.js","");let e=document.createElement("link");e.rel="stylesheet",e.type="text/css",e.href=`${ACNLclock.src}/ACNLclock/style.min.css`,document.getElementById("ACNLclock-script").after(e);let c=document.getElementById("ACNLclock");c.innerHTML=`\n\t\t\t<img src="${ACNLclock.src}/ACNLclock/acnl_clock.svg" alt="">\n\t\t\t<div class="date"><div class="month">0</div><span>/</span><div class="day">0</div></div>\n\t\t\t<div class="weekday"></div>\n\t\t\t<div class="time"><div class="hour">0</div><span>:</span><div class="minute">00</div></div>\n\t\t\t<div class="ampm"></div>\n\t\t`,ACNLclock.monthbox=c.querySelector(".month"),ACNLclock.daybox=c.querySelector(".day"),ACNLclock.hourbox=c.querySelector(".hour"),ACNLclock.minutebox=c.querySelector(".minute"),weekdaybox=c.querySelector(".weekday"),ACNLclock.ampmbox=c.querySelector(".ampm"),ACNLclock.update()},update:()=>{let e=new Date;ACNLclock.monthbox.innerHTML=e.getMonth()+1,ACNLclock.daybox.innerHTML=e.getDate(),weekdaybox.innerHTML=ACNLclock.dayNames[e.getDay()];let c=e.getHours();ACNLclock.hourbox.innerHTML=c>=12?c-12:c;let t=e.getMinutes().toString();ACNLclock.minutebox.innerHTML=t.length<2?"0"+t:t,ACNLclock.ampmbox.innerHTML=e.getHours()>=12?"pm":"am"},dayNames:["Su","Mo","Tu","We","Th","Fr","Sa"]};window.addEventListener("load",(()=>{ACNLclock.init()}));